import { styled } from '@mui/material/styles';
import Typography from '@mui/material/Typography';

export const StyledFooter = styled('footer')`
position: fixed;
left: 0;
bottom: 0;
width: 100%;
background-color: #f8f9fa;
color: black;
text-align: center;
`;

export const StyledTypography = styled(Typography)`
    text-align: center;
    color: white;
`;
